webpackJsonp([6343821853464],{2893:function(e,t){e.exports={pathContext:{docHtml:'<h1>How to Contribute</h1>\n<h2>Pull Requests</h2>\n<p>We also accept <a href="https://github.com/kpdecker/jsdiff/pull/new/master">pull requests</a>!</p>\n<p>Generally we like to see pull requests that</p>\n<ul>\n<li>Maintain the existing code style</li>\n<li>Are focused on a single change (i.e. avoid large refactoring or style adjustments in untouched code if not the primary goal of the pull request)</li>\n<li>Have <a href="http://tbaggery.com/2008/04/19/a-note-about-git-commit-messages.html">good commit messages</a></li>\n<li>Have tests</li>\n<li>Don\'t decrease the current code coverage (see coverage/lcov-report/index.html)</li>\n</ul>\n<h2>Building</h2>\n<pre><code>npm install\ngrunt\n</code></pre>\n<p>The <code>grunt dev</code> implements watching for tests within Node and <code>karma start</code> may be used for manual testing in browsers.</p>\n<p>If you notice any problems, please report them to the GitHub issue tracker at\n<a href="http://github.com/kpdecker/jsdiff/issues">http://github.com/kpdecker/jsdiff/issues</a>.</p>\n<h2>Releasing</h2>\n<p>JsDiff utilizes the <a href="https://github.com/walmartlabs/generator-release">release yeoman generator</a> to perform most release tasks.</p>\n<p>A full release may be completed with the following:</p>\n<pre><code>yo release\nnpm publish\nyo release:publish components jsdiff dist/components/\n</code></pre>',docPath:"argo-ci/node_modules/mocha/node_modules/diff/contributing",proj:"argo-ci"}}}});
